{
    static bool is_initialized = false;

    static DDS_TypeCode_Member Latency_Return_g_tc_members[1 + 1] =
    {
        {
            (char *)"unknown_operation",/* Member name */
            {
                1,/* Representation ID */
                DDS_BOOLEAN_FALSE,/* Is a pointer? */
                -1, /* Bitfield bits */
                NULL/* Member type code is assigned later */
            },
            0, /* Ignored */
            1, /* Number of labels */
            RTI_CDR_TYPE_CODE_UNION_DEFAULT_LABEL, /* First label */
            NULL, /* Labels (it is NULL when there is only one label)*/
            RTI_CDR_NONKEY_MEMBER, /* Member flags */
            DDS_PRIVATE_MEMBER,/* Ignored */
            1,
            NULL/* Ignored */
        }
                ,
                {
                    (char *)"latency",
                    {
                        0,
                        DDS_BOOLEAN_FALSE,
                        -1,
                        NULL
                    },
                    0,
                    1,
                    (RTICdrLong)0x9E800F53,
                    NULL,
                    RTI_CDR_NONKEY_MEMBER,
                    DDS_PRIVATE_MEMBER,
                    1,
                    NULL
                }
    };

    static DDS_TypeCode Latency_Return_g_tc =
    {{
         DDS_TK_UNION,
         DDS_BOOLEAN_FALSE,
         -1,
         (char*)"Latency_Return",
         NULL,
         0,
         0,
         NULL,
         1 + 1,
         Latency_Return_g_tc_members,
         DDS_VM_NONE
    }};
    
    if(!is_initialized)
    {
        Latency_Return_g_tc_members[0]._representation._typeCode = (RTICdrTypeCode *)eprosima::rpc::protocol::dds::UnknownOperationPlugin::get_typecode();
        Latency_Return_g_tc_members[1]._representation._typeCode = (RTICdrTypeCode*)LatencyPlugin::latency_ResultPlugin::get_typecode();

        Latency_Return_g_tc._data._typeCode = (RTICdrTypeCode*)&DDS_g_tc_long;

        is_initialized = true;
    }

    return &Latency_Return_g_tc;
}

